.  New York City can be loud.  At times it is obnoxiously loud.  What a contrast in sound levels from inside this magnificent space, and what a great space it is.  In truth the loudest sound was the thunderclap of my shutter which I tried to be quick about. \t \t\"The Deborah, Jonathan F. P., Samuel Priest, and Adam R. Rose Main Reading Room is a majestic public space, measuring 78 feet by 297 feet\u2014roughly the length of two city blocks\u2014and weaving together Old World architectural elegance with modern technology. The award-wining restoration of this room was completed in 1998, thanks to a fifteen million-dollar gift from Library trustee Sandra Priest Rose and Frederick Phineas Rose, who renamed the room in honor of their children.\" web \t \tThanks for looking and have a great weekend! \t_________________________________________________________________ \tComments and constructive criticism always appreciated. \tStream on Black....Follow on Facebook....My Profile (to get to webpage)", "link_status": 0, "title": "Reading Room", "locale": "en", "amp_valid": false, "amp_url": "", "url": "http://www.flickr.com/photos/darrenbarnes/11002766675/", "type": "richpindataview", "tracker": null, "apple_touch_icon_link": "https://i.pinimg.com/favicons/b4ef6053716205a6beab42b56030364fc1e6dce4e62e863b3e4adb0e.png?a4077badc755ea44f96490b95c0278a4", "favicon_images": {"50x": "https://i.pinimg.com/favicons/50x/05669be55a9e54d8014238ab627853e3bbbdf7c08c11ad8e8ff23870.png?d0236f158c380b9595ffa7c7d7d1a433", "orig": "https://i.pinimg.com/favicons/05669be55a9e54d8014238ab627853e3bbbdf7c08c11ad8e8ff23870.ico?d0236f158c380b9595ffa7c7d7d1a433"}, "article": {"description": "Another shot from a recent trip to NYC. This time from the New York Public Library. New York City can be loud. At times it is obnoxiously loud. What a contrast in sound levels from inside this magnificent space, and what a great space it is. In truth the loudest sound was the thunderclap of my shutter which I tried
